import React from "react";
import { Card } from "../../Card.styled";
import { ImageCard } from "../../ImageCard.styled";

const Grid1 = ({ styles, UI }) => {
  return (
    <Card bd={"1px solid red"} dp={"grid"} gridC={"80% 20%"}>
      <Card dp={"grid"} gridC={"70% 30%"} bd={"1px solid blue"}>
        <Card bd={"1px solid black"}>
          <Card cl={styles.colors.textAlt} fs={"1.5rem"}>
            Trending
          </Card>
          <Card fs={"2rem"}>
            <b>Auctions.</b>
          </Card>
          <Card cl={styles.colors.textAlt} fs={"0.8rem"}>
            Enjoy! the latest hot auctions.
          </Card>
        </Card>
      </Card>
      <Card bd={"4px solid green"}>
        <Card width={"6rem"} mg={"1rem auto"} bd={"1px solid red"}>
          <ImageCard
            width={"2rem"}
            height={"2rem"}
            mg={"0rem 0.5rem"}
            src={UI.NextArrow}
          />
          <ImageCard mg={"0rem 0.5rem"} src={UI.PreviousArrow} />
        </Card>
      </Card>
    </Card>
  );
};

export default Grid1;
